import React from 'react'
import { moves } from './data'

const PokeMoves = () => {
  return (
    <div>
        <h1>PokeMoves</h1>
        <ul>
            {moves.map(key => (
                <li>
                    {key.id}.{item.move}
                </li>
            ))}
        </ul>
    </div>
  )
}

export default PokeMoves
